create table VIDEO (
	id INT AUTO_INCREMENT PRIMARY KEY,
	name VARCHAR(50),
	youtuber_id INT,
	lenght INT,
	nb_views INT,
	nb_shares INT,
	nb_like INT,
	nb_dislike INT,
	comments TEXT,
	monetization boolean,
	ads boolean,
constraint fk_video_Youtuber foreign key(youtuber_id) references YOUTUBER(id)
);
